value:
I really enjoyed working with you. I enjoy the enthusiasm and fun spirited feelings you bring to the group. I valued your ability to take the difficulty in stride without getting frustrated no matter the insurmountably. This helped me to keep from getting frustrated myself, and allowed me to dive deeper and deeper into unknown territory (oAuth) without fear of burdening or frustrating my team. I like that you asked questions about the process we had, and made attempts to talk out potential solutions, even though I "shot you down" a few times, you didn't take it personally and understood/became more curious to the underlying reason for why any given idea might or might not be good for the project. The way you handle learning will get you far.

I would want to work with you again if you become more self-confident. Although this might simply come all on its own from gathering more experience, I feel you sometimes shoot yourself down early. Don't judge a fish by it's ability to fly: Your skill in programming and syntax comes second, what you already have is your ability to problem solve, and you made that apparent when asking questions about when a for loop goes where etc. Breaking habits is difficult; 
I feel like you apologized very often when you've done nothing wrong, and that makes me feel mildly uncomfortable. But I'm not sure why. Take with a grain of salt - and feel free to ask me in person if you want me to go into more detail.
